!function($) {
	"use strict";
	
    /* Init page load preview-image */
    var preview_wrapper 	= '.catanis_preview_image_wrapper';
    var preview_selectbox 	= '.catanis_preview_image_select';
    var preview_selectbox_selected = '.catanis_preview_image_select option:selected';
    
    $(preview_wrapper).hide();
    var selected_value =  $(preview_selectbox_selected).val();
    if(selected_value){
    	var imgSrc = $(preview_selectbox_selected).data("imgSrc");
    	if(imgSrc){
    		$(preview_selectbox).parent().find(preview_wrapper).show();
        	$(preview_selectbox).parent().find(preview_wrapper + ' img').attr("src", imgSrc);
    	}
    }
    
    $(preview_selectbox).bind('change keyup', function(e) {
    	selected_value = $(this).val();
    	if(selected_value){
    		var imgSrc = $(this).find(":selected").data("imgSrc");
    		$(this).parent().find(preview_wrapper).show();
    		$(this).parent().find(preview_wrapper + ' img').attr("src", imgSrc);
    	}else{
    		 $(preview_wrapper).hide();
    	}
      
    });
    
    /*ca_vc_radio_image_select*/
    $(".ca_vc_radio_image_select").each(function (ind, elem) {
    	$(this).imagepicker();
    });
    
    /*vc_range*/
    $(".vc_slider").each(function () {

        var $this = $(this),
            MDslider = $this.get(0),
            start = Number($this.attr('value')),
            min   = Number($this.attr('min')),
            max   = Number($this.attr('max')),
            step  = Number($this.attr('step')),
            decimal  = Number($this.attr('decimal')),
            prefix  = $this.attr('prefix');

        noUiSlider.create(MDslider, {
            start: [ start ],
            tooltips: [ wNumb({ decimals: decimal}) ],
            connect: 'lower',
            step: step,
            range: {
                'min': min,
                'max': max
            }
        });
        
        MDslider.noUiSlider.on('update', function(values){
            $this.parent('.edit_form_line').find('#input-'+$this.attr('id')).val(catanis_updateDesimal(values[0],step));
            $this.parent('.edit_form_line').find('.vc_slider_value').html(catanis_updateDesimal(values[0],step) + prefix);
            updateSliderValue(MDslider);
        });
    });
    

    function catanis_updateDesimal(val, step){
        if(step>=1){
            return val.substr(0, val.length-3);
        }else if(step >= 0.1){
            return val.substr(0, val.length-1);
        }else if(step <0.1){
            return val;
        }
    }

    function updateSliderValue(slider, handle) {
        var children, i, results, val, values;
        if (handle == null) {
          handle = 0;
        }
        children = slider.getElementsByClassName('noUi-handle');
        values = slider.noUiSlider.get();
        i = 0;
        results = [];
        while (i < children.length) {
          if (children.length === 1) {
            val = parseInt(values);
          } else {
            val = parseInt(values[i]);
          }
          children[i].dataset.value = val;
          results.push(i++);
        }
        return results;
    };
    
}(window.jQuery);